FeedPackage.ReleaseNotes:
1. Fixed bug on message id generation;
1.1 removed GetMessageId() and messageIdCounter from MqttMsgBase, because messaged id generation is related to client not to message;
1.2 removed internal message id generation from MqttMsgPublish, MqttMsgSubscribe and MqttMsgUnsubscribe classes (it must be set external);
1.3 added GetMessageId() for message id generation inside MqttClient class;
2. Completed all messages classes with GetBytes() and Parse() methods;
3. Removed unused namespaces;
4. Added interface IMqttNetworkChannel for network channel abstraction implementation;
5. Added solution for VS2008 and project for .Net Compact Framework 3.5 on Windows Embedded Compact 7;
6. Removed all default parameters values in constructors and methods for compatibility with .Net Framework under 4.0 version;

Added "inflight queue" for messages and asynchronous operations (publish, subscribe, unsubscribe)

1. Added MqttMsgContext class with the flow context of a message inside "inflight queue";
2. Added MqttSettings to store default client settings;
3. Modified MqttClient :
3.1 added "inflight queue", internal queue and receive queue (for raise event to the application layer);
3.2 modified Subscribe() method to be asynchronous and now returns message id (not granted QoS);
3.3 modified Unsubscribe() method to be asynchronous;
3.4 modified Publish() method to be asynchronous;
3.5 added ReceiveEventThread() to raise event;
3.6 added ProcessInflightThread() to process "inflight queue";
4. Released new version 3.0.0.0;

1. Uniformed all classes to the GnatMQ broker (https://mqttbroker.codeplex.com/) to have same core;
2. MqttClient : exposed all main client properties after connection (clientId, clean session, will flag, will topic, will QoS and will message);
3. MqttMsgPublishEventArgs : added DupFlag property;
4. MqttCommunicationException : Added constructor for inner exception;
5. Improved QoS Level 2 management in MqttClient;
6. Added QueueExtension to get an element by predicate;
7. Released new version 3.1.0.0;

1. MqttClient :
1.1 added more overloads for Connect() method;
1.2 exposed client disconnection (from broker) event;
2. Released new version 3.3;

1. Added tracing features in DEBUG mode with Trace class and TraceLevel enumeration;
2. MqttClient : added tracing usage;
3. Changed license header in all files with unique M2Mqtt project reference for client and broker (GnatMQ);
4. Released new version 3.4;

1. MqttClient :
1.1 exposed callback for SSL/TLS server certificate validation;
1.2 exposed callback for SSL/TLS client certificate selection;
2. tracing under TRACE symbol;
3. Bug fixing from issues tab on CodePlex web site;
4. License changed from L-GPL to Apache 2.0;
5. Released new version 3.5;

1. Moved all protocol related processing from MqttClient to classes that implements IMqttNetworkChannel interface (for WinRT support);
2. Added Fx class for framework specific methods (for WinRT support);
3. Created new M2MqttWinRT project (under new Visual Studio 2013 solution);
4. Implemented MqttNetworkChannel for WinRT (for WinRT support);
5. Derived all exceptions from base class Exception and not ApplicationException (for WinRT support);
6. Update projects with different reference to Net or WinRT folder;
7. Released new version 3.6;

1. Support for old 3.1.0 and new 3.1.1 OASIS specification;
2. Added session management (however without persistence) for supporting for 3.1.1 specification;
3. Keep Alive ping request disabled if keep alive timeout is set to zero;
4. Inflight queue size managed;
5. Improvement on receiving thread with some modification on underlying network channel;
6. Bug fixing from issues on CodePlex panel;
7. Released new version 4.0;
